import React, { useState}from 'react';
import axios from 'axios';
import './App.css';
import Main from './components/Main';
import Navbar from './components/Navbar';
import Footer from './components/Footer';

function App() {
  const [formData, setFormData] = useState({
    Ndehistoriaclinica: '',
    nombre: '',
    apellido: '',
    genero: '',
    Fechadenacimiento: '',
    Enfermedad: '',
    otrasenfermedades: '',
    tratamiento: '',
    genotipos: '',
  });

  const [resultadosData, setResultadosData] = useState({
    Genotipo: '',
    Fenotipo: '',
    Populación: '',
    Implicaciones: '',
    Recomendación: '',
    OtrasConsideraciones: '',
    Clasificación: '',
  });

  const [resultados, setResultados] = useState(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = () => {

      axios
        .get(`/data/gene/${geneId}`, {
          headers: {
            'Api-Key': 'TU_CLAVE_DE_API',
          },
        })

        .then((response) => {
          // Procesa la respuesta de la API de PharmGKB
          const geneInfo = response.data;

          // Actualiza el estado con los datos relevantes
          setResultadosData({
            Genotipo: geneInfo.genotype,
            Fenotipo: geneInfo.phenotype,
            Populación: geneInfo.population,
            Implicaciones: geneInfo.implications,
            Recomendación: geneInfo.recommendation,
            OtrasConsideraciones: geneInfo.otherConsiderations,
            Clasificación: geneInfo.classification,
          });
        })
        .catch((error) => {
          console.error('Error al consultar la API de PharmGKB:', error);
          // Maneja errores aquí
        });
  };

/*
  const resultadosData = {
    Genotype: 'CYP2C19: *1/*2',
    Phenotype: 'CYP2C19: Intermediate Metabolizer',
    Population: 'Patients with cardiovascular indications of acute coronary syndrome (ACS) and/or percutaneous coronary intervention (PCI).',
    Implications: 'CYP2C19: Reduced clopidogrel active metabolite formation; increased on-treatment platelet reactivity; increased risk for adverse cardiac and cerebrovascular events',
    Recommendation: 'Avoid standard dose (75 mg) clopidogrel if possible. Use prasugrel or ticagrelor at standard dose if no contraindication.',
    OtherConsiderations: 'For cardiovascular indications of acute coronary syndrome (ACS) and/or percutaneous coronary intervention (PCI). ACS and/or PCI includes patients undergoing PCI for an ACS or non-ACS (elective) indication.',
    Classification: 'Strong',
  };
  */


  const handleDownloadPDF = () => {
    // Lógica para generar y descargar un PDF.
    // ...
  };


  return (
    <div className="App">
      <Navbar />
      <div className="Todo">
      <div className="main-content">
        <div className="row">
          <div className="column">
            <Main formData={formData} handleInputChange={handleInputChange} />
          </div>
          <div className="column column-center">
            <div className="buttons-container">
              <button id="descargarBtn" onClick={handleSubmit}>Mostrar Resultados</button>
              <button type="submit" onClick={handleDownloadPDF}>Descargar PDF</button>
            </div>
          </div>
          <div className="column resultado-column">
            <div className="resultado-container">
                <h2>RESULTADO</h2>

                <div className="result-details">
                  <p className="result-section">
                    <strong>Genotype:</strong> {resultadosData.Genotype}
                  </p>
                  <p className="result-section">
                    <strong>Phenotype:</strong> {resultadosData.Phenotype}
                  </p>
                  <p className="result-section">
                    <strong>Population:</strong> {resultadosData.Population}
                  </p>
                  <p className="result-section">
                    <strong>Implications:</strong> {resultadosData.Implications}
                  </p>
                  <p className="result-section">
                    <strong>Recommendation:</strong> {resultadosData.Recommendation}
                  </p>
                  <p className="result-section">
                    <strong>Other Considerations:</strong> {resultadosData.OtherConsiderations}
                  </p>
                  <p className="result-section">
                    <strong>Classification:</strong> {resultadosData.Classification}
                  </p>
                </div>
            </div>
          </div>
        </div>
      </div>
      </div>
      <Footer />
    </div>
  );
}


export default App;
